import React from 'react'
import { FaDesktop } from "react-icons/fa";

export default function Homeservicebox() {
  return (
    <div>
        {/* repeating card */}
      <div>
            <div>
                <FaDesktop />
                </div>
            <div>Web Design</div>
            <div>
            I do ui/ux design for the website that helps website to get a unique look.
            </div>
      </div>
      
    </div>
  )
}
